"use strict";

function countLetters(s) {
    let n = s.length;
    let i = 0;
    let ans = 0;
    while (i < n) {
        let j = i;
        while (j < n && s[j] === s[i]) {
            j += 1;
        }
        ans += ((1 + j - i) * (j - i)) / 2;
        i = j;
    }
    return ans;
}
